import React from 'react';
import './App.css';

// const currencies: string[] = [ 'EUR', 'PLN', 'GEL', 'DKK', 'CZK', 'GBP', 'SEK', 'USD', 'RUB' ];

let shoppingCart = [
{id: 35, item: 'jumper', color: 'red', size: 'medium', price: 20},
{id: 42, item: 'shirt', color: 'blue', size: 'medium', price: 15},
{id: 71, item: 'socks', color: 'black', size: 'all', price: 5},
]

const App: React.FC = (item: string,) => {

  return (
    <div>
this.items = this.state.cart.map((item, key) =>
    <li key={item.id}>{item.name}</li>
);
    </div>
  );
}

export default App;
